import{o as e,c as a,a as t}from"./app.3963d341.js";const n='{"title":"Let\'s Plays","description":"","frontmatter":{},"headers":[{"level":2,"title":"Blasting to Bedrock","slug":"blasting-to-bedrock"},{"level":3,"title":"Stats","slug":"stats"},{"level":3,"title":"Rules","slug":"rules"}],"relativePath":"lets-plays.md","lastUpdated":1628960738489}',s={},l=[t('<h1 id="let-s-plays"><a class="header-anchor" href="#let-s-plays" aria-hidden="true">#</a> Let&#39;s Plays</h1><p>From time to time, I might do a let&#39;s play for Minecraft. This page stands as a link to direct you to some information about them.</p><h2 id="blasting-to-bedrock"><a class="header-anchor" href="#blasting-to-bedrock" aria-hidden="true">#</a> Blasting to Bedrock</h2><p><img src="https://docs.google.com/drawings/d/e/2PACX-1vQ4d6YJDvkRCvENyWSsa4MyeM52jPJ44wbaHjRxOnYL3inQbNr_a1iUhBNzH9BhYQKmU8p2-lBEzg2P/pub?w=320&amp;h=320" alt="Blasting to Bedrock Chunk Graph"></p><p>Blasting to Bedrock is an idle series, where the goal is to mine to bedrock, chunk by chunk. The last time this was played was during Season 0. A video hasn&#39;t been made in quite a while, so this series is now classified as idle, but not necessarily over. All videos related to it, except for <a href="https://youtu.be/DwC3wwHg7Lw" target="_blank" rel="noopener noreferrer">Episode 7</a>, have been <a href="https://youtube.com/playlist?list=PLY2Ab8ZVEQnSTcWNj9EfNBWEyyjpzBAsZ" target="_blank" rel="noopener noreferrer">unlisted</a>.</p><h3 id="stats"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h3><ul><li>Start date: Wednesday, April 22, 2020 (As Season 1)*</li><li>End date: N/A (As Season 0)*</li><li>1.14.60 seed: -574766403</li><li>Claimed chunks: 9</li><li>Latest Claimed chunk: &quot;Spawn&quot;</li><li>*On June 9, 2020, I released a <a href="https://youtu.be/1BgSL4yQSwI" target="_blank" rel="noopener noreferrer">video</a> announcing the season, which was formerly Season 1, would be changed to Season 0. Unfortunately, I have since removed that video.</li></ul><h3 id="rules"><a class="header-anchor" href="#rules" aria-hidden="true">#</a> Rules</h3><h4 id="general"><a class="header-anchor" href="#general" aria-hidden="true">#</a> General</h4><ul><li>After spawning in, you can only place blocks in the chunk in which you spawned.</li><li>You can place blocks only in &quot;claimed&quot; chunks (or spawn, to an extent). To claim, you must destroy all the blocks, minus Bedrock and a few other special blocks.</li><li>Once you mine the 8 chunks around the spawn chunk, the spawn chunk must then be destroyed.</li><li>Spawners do not have to be destroyed.</li><li>If there is an infinite water source in the chunk, you may remove all other blocks, then place blocks to remove the water. Those blocks also then must be destroyed.</li><li>You may not mine ores in unclaimed chunks.</li><li>You need to claim 9 chunks to be eligible for the Nether, and 25 overworld + 9 nether chunks for the End.</li></ul><h4 id="nether"><a class="header-anchor" href="#nether" aria-hidden="true">#</a> Nether</h4><ul><li>You may mine from <strong>Y 64</strong> to <strong>Y 0</strong>, then place blocks to mine from <strong>Y 64</strong> to <strong>Y 128</strong>. The blocks placed must then be destroyed again to claim the chunk.</li><li>The chunk(s) where the first portal generates may be left as is, until all surrounding chunks have been mined.</li></ul><h4 id="end"><a class="header-anchor" href="#end" aria-hidden="true">#</a> End</h4><ul><li>You may place blocks in the Main Island until the Dragon is dead.</li><li>You may place blocks in the chunk(s) where the portal is, until all surrounding chunks are mined.</li></ul>',14)];s.render=function(t,n,s,o,r,i){return e(),a("div",null,l)};export{n as __pageData,s as default};
